const Header = () => {
  return (
    <header className="header">
      <h1>
        Dead
        <a href="http://www.deadcatapp.com/" target="_blank">
          <img className="deadCat-header" src="./images/deadCatLogo.png" />
        </a>
        Cat
      </h1>
    </header>
  );
};

export default Header;
